For dynamically-checked and unchecked casting between arbitrary JavaScript types, we introduce the JsCast trait. It requires implementations provide a boolean predicate that consults JavaScript's instanceof operator, as well as unchecked conversions from JavaScript values: pub trait JsCast { fn instanceof(val: &JsValue) -> bool; fn unchecked_from_js(val: JsValue) -> Self; fn unchecked_from_js_ref(val: &JsValue) -> &Self; fn unchecked_from_js_mut(val: &mut JsValue) -> &mut Self; // ... provided methods elided ...
} JsCast 's required trait methods are not intended to be used to directly, but instead are leveraged by its provided methods. Users of wasm-bindgen will be able to ignore JsCast 's required trait methods for the most part, since the implementations will be mechanically generated, and they will only be using the required trait methods indirectly through the more ergonomic provided methods. For every extern { type Illmatic; } imported with wasm-bindgen , we emit an implementation of JsCast similar to this: impl JsCast for Illmatic { fn instanceof(val: &JsValue) -> bool { #[cfg(all(target_arch = "wasm32", not(target_os = "emscripten")))] #[wasm_import_module = "__wbindgen_placeholder__"] extern { fn __wbindgen_instanceof_Illmatic(idx: u32) -> u32; } #[cfg(not(all(target_arch = "wasm32", not(target_os = "emscripten"))))] unsafe extern fn __wbindgen_instanceof_Illmatic(_: u32) -> u32 { panic!("function not implemented on non-wasm32 targets") } __wbindgen_instance_of_MyDerived(val.idx) == 1 } fn unchecked_from_js(val: JsValue) -> Illmatic { Illmatic { obj: val, } } fn unchecked_from_js_ref(val: &JsValue) -> &Illmatic { unsafe { &*(val as *const JsValue as *const Illmatic) } } fn unchecked_from_js_mut(val: &mut JsValue) -> &mut Illmatic { unsafe { &mut *(val as *mut JsValue as *mut Illmatic) } }
} Additionally, wasm-bindgen will emit this JavaScript definition of __wbindgen_instanceof_Illmatic that simply wraps the JS instanceof operator: const __wbindgen_instanceof_Illmatic = function (idx) { return getObject(idx) instanceof Illmatic;
};

