where Self: AsRef<JsValue> + AsMut<JsValue> + Into<JsValue>,
{ // ... required trait methods elided ... // Unchecked conversions from `Self` into some other `T: JsCast`. fn unchecked_into<T>(self) -> T where T: JsCast, { T::unchecked_from_js(self.into()) } fn unchecked_ref<T>(&self) -> &T where T: JsCast, { T::unchecked_from_js_ref(self.as_ref()) } fn unchecked_mut<T>(&mut self) -> &mut T where T: JsCast, { T::unchecked_from_js_mut(self.as_mut()) } // Predicate method to check whether `self` is an instance of `T` or not. fn is_instance_of<T>(&self) -> bool where T: JsCast, { T::instanceof(self.as_ref()) } // Dynamically-checked conversions from `Self` into some other `T: JsCast`. fn dyn_into<T>(self) -> Result<T, Self> where T: JsCast, { if self.is_instance_of::<T>() { Ok(self.unchecked_into()) } else { Err(self) } } fn dyn_ref<T>(&self) -> Option<&T> where T: JsCast, { if self.is_instance_of::<T>() { Some(self.unchecked_ref()) } else { None } } fn dyn_mut<T>(&mut self) -> Option<&mut T> where T: JsCast, { if self.is_instance_of::<T>() { Some(self.unchecked_mut()) } else { None } }
} Using these methods provides better turbo-fishing syntax than using JsCast 's required trait methods directly. fn get_it() -> JsValue { ... } // Tired -_-
