The initial motivation for this is outlined RFC 3 , namely that the web-sys crate provides bindings for many APIs found on the web but accessing the functionality of parent classes is quite cumbersome. The web makes extensive use of class inheritance hierarchies, and in web-sys right now each class gets its own struct type with inherent methods. These types implement AsRef between one another for subclass relationships, but it's quite unergonomic to actually reference the functionality! For example: let x: &Element = ...;
let y: &Node = x.as_ref();
y.append_child(...); or... let x: &Element = ...;
<Element as AsRef<Node>>::as_ref(x) .append_child(...); It's be much nicer if we could support this in a more first-class fashion and make it more ergonomic! Note : While this RFC has the same motivation as RFC 3 it's proposing an alternative solution, specifically enabled by switching by structural by default, which is discussed in RFC 3 but is hopefully formally outlined here.

