This RFC proposes using the built-in Deref trait to model the class hierarchy found on the web in web-sys . This also proposes changes to #[wasm_bindgen] to make using Deref feasible for binding arbitrary JS apis (such as those on NPM) with Deref as well. For example, web-sys will contain: impl Deref for Element { type Target = Node; fn deref(&self) -> &Node { /* ... */ }
} allowing us to write our example above as: let x: &Element = ...;
x.append_child(...); // implicit deref to `Node`! All JS types in web-sys and in general have at most one superclass. Currently, however, the #[wasm_bindgen] attribute allows specifying multiple extends attributes to indicate superclasses: #[wasm_bindgen]
extern { #[wasm_bindgen(extends = Node, extends = Object)] type Element; // ...
} The web-sys API generator currently lists an extends for all superclasses, transitively. This is then used in the code generator to generate AsRef implementatiosn for Element . The code generation of #[wasm_bindgen] will be updated with the following rules: If no extends attribute is present, defined types will implement Deref<Target=JsValue> . Otherwise, the first extends attribute is used to implement Deref<Target=ListedType> . (long term, currently require a breaking change) reject multiple extends attributes, requiring there's only one. This means that web-sys may need to be updated to ensure that the immediate superclass is listed first in extends . Manual bindings will continue to work and will have the old AsRef implementations as well as a new Deref implementation. The Deref implementation will concretely be implemented as: impl Deref for #imported_type { type Target = #target_type; #[inline] fn deref(&self) -> &#target_type { ::wasm_bindgen::JsCast::unchecked_ref(self) }
}

