One pretty reasonable question you might have at this point is "why, if structural is the default today, is it ok to switch?" To answer this, let's first explore why final is the default today! From its inception wasm-bindgen has been designed with the future host bindings proposal for WebAssembly. The host bindings proposal promises faster-than-JS DOM access by removing many of the dynamic checks necessary when calling DOM methods. This proposal, however, is still in relatively early stages and hasn't been implemented in any browser yet (as far as we know). In WebAssembly on the web all imported functions must be plain old JS functions. They're all currently invoked with undefined as the this parameter. With host bindings, however, there's a way to say that an imported function uses the first argument to the function as the this parameter (like Function.call in JS). This in turn brings the promise of eliminating any shim functions necessary when calling imported functionality . As an example, today for #[wasm_bindgen(method)] fn parent(this: &Parent); we generate JS that looks like: #[wasm_bindgen(method)]
fn method(this: &Parent); means that the following JS code is generated: const Parent_method_target = Parent.prototype.method; export function __wasm_bindgen_Parent_method(idx) { Parent_method_target.call(getObject(idx));
} If we assume for a moment that anyref is implemented we could instead change this to: const Parent_method_target = Parent.prototype.method; export function __wasm_bindgen_Parent_method(obj) { Parent_method_target.call(obj);
} (note the lack of need for getObject ). And finally, with host bindings we can say that the wasm module's import of __wasm_bindgen_Parent_method uses the first parameter as this , meaning we can transform this to: export const __wasm_bindgen_Parent_method = Parent.prototype.method; and voila , no JS function shims necessary! With structural we'll still need a function shim in this future world: export const __wasm_bindgen_Parent_method = function() { this.method(); }; Alright, with some of those basics out of the way, let's get back to why- final -by-default. The promise of host bindings is that by eliminating all these JS function shims necessary we can be faster than we would otherwise be, providing a feeling that final is faster than structural . This future, however, relies on a number of unimplemented features in wasm engines today. Let's consequently get an idea of what the performance looks like today! I've been slowly over time preparing a microbenchmark suite for measuring JS/wasm/wasm-bindgen performance. The interesting one here is the benchmark " structural vs not". If you click "Run test" in a browser after awhile you'll see two bars show up. The left-hand one is a method call with final and the right-hand one is a method call with structural . The results I see on my computer are: Firefox 62, structural is 3% faster Firefox 64, structural is 3% slower Chrome 69, structural is 5% slower Edge 42, structural is 22% slower Safari 12, strutural is 17% slower So it looks like for Firefox/Chrome it's not really making much of a difference but in Edge/Safari it's much faster to use final ! It turns out, however, that we're not optimizing structural as much as we can. Let's change our generated code from: const Parent_method_target = function() { this.method(); }; export function __wasm_bindgen_Parent_method(obj) { Parent_method_target.call(getObject(obj));
} to... export function __wasm_bindgen_Parent_method(obj) { getObject(obj).method();
} (manually editing the JS today) and if we rerun the benchmarks (sorry no online demo) we get: Firefox 62, structural is 22% faster Firefox 64, structural is 10% faster Chrome 69, structural is 0.3% slower Edge 42, structural is 15% faster Safai 12, structural is 8% slower and these numbers look quite different! There's some strong data here showing that final is not universally faster today and is actually almost universally slower (when we optimize structural slightly). Ok! That's all basically a very long winded way of saying final was the historical default because we thought it was faster, but it turns out that in JS engines today it isn't always faster . As a result, this RFC proposes that it's ok to make structural the default.

