The most user-facing change proposed here is the reinterpretation of the module attribute inside of #[wasm_bindgen] and the addition of an inline_js attribute. They can now be used to import local files and define local imports like so: #[wasm_bindgen(module = "/js/foo.js")]
extern "C" { // ... definitions
} #[wasm_bindgen(inline_js = "export function foo() {}")]
extern "C" { fn foo();
} The first declaration says that the block of functions and types and such are all imported from the /js/foo.js file, relative to the current file and rooted at the crate root. The second declaration lists the JS inline as a string literal and the extern block describes the exports of the inline module. The following rules are proposed for interpreting a module attribute. If the strings starts with the platform-specific representation of an absolute path to the cargo build directory (identified by $OUT_DIR ) then the string is interpreted as a file path in the output directory. This is intended for build scripts which generate JS files as part of the build. If the string starts with / , ./ , or ../ then it's considered a path to a local file. If not, then it's passed through verbatim as the ES module import. All paths are resolved relative to the current file, like Rust's own #[path] , include_str! , etc. At this time, however, it's unknown how we'd actually do this for relative files. As a result all paths will be required to start with / . When proc_macro has a stable API (or we otherwise figure out how) we can start allowing ./ and ../ -prefixed paths. This will hopefully roughly match what programmers expect as well as preexisting conventions in browsers and bundlers. The inline_js attribute isn't really intended to be used for general-purpose development, but rather a way for procedural macros which can't currently today rely on the presence of $OUT_DIR to generate JS to import.

